import React from "react";
import "./App.css";
import Random from "./Random";
import Search from "./Search";
import About from "./About";
import Nav from "./Nav";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <Random />
        <Search />
        <About />
      </div>
    </Router>
  );
}

export default App;
